FROM detail_obat,obat, master_detail_obat, satuan

where detail_obat.deleted=0 
and master_detail_obat.id_master_detail=detail_obat.id_master_detail 
and satuan.kd_satuan=obat.kd_satuan
and obat.nama like CONCAT('%', nama , '%')
and detail_obat.id_obat=obat.id_obat order by time DESC; 


END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `SO1` (IN `id_obat` INT(10), IN `no_reg` VARCHAR(255), IN `no_batch_old` VARCHAR(255), IN `tgl_exp_old` DATE, IN `sisa_stok` INT(10))  BEGIN

	UPDATE detail_obat SET sisa_stok=0 WHERE no_batch=no_batch_old AND no_reg.no_reg AND id_obat=id_obat AND tgl_exp=tgl_exp_old;
	END$$

