--
-- Struktur untuk view `data_pembelian`
--
DROP TABLE IF EXISTS `data_pembelian`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `data_pembelian`  AS  select `a`.`id_master_detail` AS `id_master_detail`,`a`.`no_faktur` AS `no_faktur`,`a`.`tgl_jatuh_tempo` AS `tgl_jatuh_tempo`,`a`.`tgl_faktur` AS `tgl_faktur`,`a`.`tgl_input` AS `tgl_input`,`suplier`.`nama` AS `nama_suplier`,`metode_pembayaran`.`nama_metode_pembayaran` AS `metode_pembayaran`,`b`.`hrg_stl_pajak` AS `hrg_stl_pajak`,`b`.`user_verified` AS `user_verified`,`c`.`id_user` AS `id_user` from ((((`master_detail_obat` `a` left join `detail_obat` `c` on(`a`.`id_master_detail` = `c`.`id_master_detail`)) left join `suplier` on(`a`.`kd_suplier` = `suplier`.`kd_suplier`)) left join `metode_pembayaran` on(`a`.`kode_pembayaran` = `metode_pembayaran`.`kd_pembayaran`)) left join `detail_kalkulasi_item_pembelian` `b` on(`a`.`id_master_detail` = `b`.`id_master_detail`)) ;

