DROP TABLE IF EXISTS `detail_kalkulasi_item_pembelian`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `detail_kalkulasi_item_pembelian`  AS  select `kalkulasi_item_pembelian`.`id_master_detail` AS `id_master_detail`,sum(`kalkulasi_item_pembelian`.`sub_total1`) AS `total_stl_potongan`,sum(`kalkulasi_item_pembelian`.`potongan`) AS `potongan`,sum(`kalkulasi_item_pembelian`.`sub_total1`) * (10 / 100) AS `nilai_pajak`,sum(`kalkulasi_item_pembelian`.`sub_total1`) + sum(`kalkulasi_item_pembelian`.`sub_total1`) * (10 / 100) AS `hrg_stl_pajak`,`detail_obat`.`user_verified` AS `user_verified` from (`kalkulasi_item_pembelian` left join `detail_obat` on(`detail_obat`.`id_master_detail` = `kalkulasi_item_pembelian`.`id_master_detail`)) group by `kalkulasi_item_pembelian`.`id_master_detail` ;

