INSERT INTO `prosedur` (`id`, `query`) VALUES
(1, 'CREATE DEFINER=`root`@`localhost` PROCEDURE `obat_fitur_penjualan`()\r\nBEGIN \r\n    \r\n    SELECT DISTINCT(A.id_obat), B.barcode, B.nama\r\n    FROM detail_obat A\r\n    INNER JOIN obat B\r\n    ON A.id_obat = B.id_obat and A.sisa_stok>0 and A.harga_jual>0;\r\n \r\nEND');
